import React from "react"
import ContentLoader from "react-content-loader"

const InfoLoader = () => (
    <ContentLoader
        speed={1}
        width={900}
        height={260}
        viewBox="0 0 870 260"
        backgroundColor="#dedede"
        foregroundColor="#f5f5f5"
    >
        <rect x="0" y="0" rx="2" ry="2" width="870" height="260" />
    </ContentLoader>
)

export default InfoLoader;
